import React, { useEffect, useState } from 'react';
import DatePicker from 'react-datepicker';
import 'react-datepicker/dist/react-datepicker.css';
import "./HomePage.css";

const HomePage = ({ user }) => {
  const [startDate, setStartDate] = useState(new Date());
  const [endDate, setEndDate] = useState(new Date());
  const [viewByDay, setViewByDay] = useState(false);
  const [numberOfDays, setNumberOfDays] = useState(7); // Default to 7 days for 'This Week'

  useEffect(() => {
    const today = new Date();
    const currentDayOfWeek = today.getDay(); // TODAY

    // Fonction pour générer des données pour la période sélectionnée
    const generateRandomData = (numPoints) => Array.from({ length: numPoints }, (_, i) => i + 1);

    const data = {
      thisWeek: generateRandomData(7),
      lastTwoWeeks: generateRandomData(14),
      thisMonth: generateRandomData(new Date(today.getFullYear(), today.getMonth() + 1, 0).getDate())
    };

    const script = document.createElement('script');
    script.src = 'https://cdn.jsdelivr.net/npm/chart.js';
    script.async = true;
    document.body.appendChild(script);

    script.addEventListener('load', () => {
      const ctx = document.getElementById('myChart').getContext('2d');
      const gradient = ctx.createLinearGradient(0, 0, 0, 400);
      gradient.addColorStop(0, 'rgba(67, 121, 238, 0.5)');
      gradient.addColorStop(1, 'rgba(255, 255, 255, 0.01)');

      const config = {
        type: 'line',
        data: {
          labels: viewByDay ? Array.from({ length: numberOfDays }, (_, i) => i + 1) : data['thisWeek'],
          datasets: [{
            label: 'Chiffre d\'affaire',
            data: viewByDay ? generateRandomData(numberOfDays) : data['thisWeek'],
            backgroundColor: gradient,
            borderColor: '#4379EE',
            borderWidth: 2,
            fill: true,
            pointBackgroundColor: '#4379EE',
            pointBorderColor: '#4379EE',
            pointRadius: 3
          }]
        },
        options: {
          scales: {
            y: {
              beginAtZero: true,
              stacked: true,
              grid: {
                color: '#ffffff00',
              },
              ticks: {
                color: '#202224',
              }
            },
            x: {
              grid: {
                color: '#ffffff00',
              },
              ticks: {
                color: '#202224',
              }
            }
          },
          plugins: {
            legend: {
              display: false
            }
          }
        }
      };

      let myChart = new window.Chart(ctx, config);

      document.getElementById('time-period').addEventListener('change', (e) => {
        const selectedOption = e.target.value;
        switch (selectedOption) {
          case 'thisWeek':
            setNumberOfDays(7);
            break;
          case 'lastTwoWeeks':
            setNumberOfDays(14);
            break;
          case 'thisMonth':
            setNumberOfDays(new Date(today.getFullYear(), today.getMonth() + 1, 0).getDate());
            break;
          default:
            setNumberOfDays(7);
        }
        myChart.data.labels = viewByDay ? Array.from({ length: numberOfDays }, (_, i) => i + 1) : data[selectedOption];
        myChart.data.datasets[0].data = viewByDay ? generateRandomData(numberOfDays) : data[selectedOption];
        myChart.update();
      });

      return () => {
        document.body.removeChild(script);
        myChart.destroy();
      };
    });

  }, [startDate, endDate, viewByDay, numberOfDays]);

  const handleDateChange = (dates) => {
    const [start, end] = dates;
    setStartDate(start);
    setEndDate(end);
    setViewByDay(true);
  };

  return (
    <section className="dashboard-container">
      <div className="graph">
        <div className="graph-title-container">
          <h3>Title</h3>
          <div className="date-select">
            <div className="view-toggle">
              <DatePicker
                selected={startDate}
                onChange={handleDateChange}
                startDate={startDate}
                endDate={endDate}
                selectsRange
                inline
              />
            </div>
            <select name="time-period" id="time-period" onChange={(e) => setViewByDay(e.target.value === 'thisWeek')}>
              <option value="thisWeek">This Week</option>
              <option value="lastTwoWeeks">Last Two Weeks</option>
              <option value="thisMonth">This Month</option>
            </select>
          </div>
        </div>
        <div className="grap">
          <canvas className="income-graph" id="myChart"></canvas>
        </div>
      </div>
    </section>
  );
};

export default HomePage;
